import React from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { logoutSucces } from "../redux/authActions";
import ProfileImageWithDefault from "./ProfileImageWithDefault";
import { useTranslation } from "react-i18next";
import logo from "../assets/logo.png";
import LanguageSelector from "./LanguageSelector";

const Sidebar = () => {
  const { displayName, isLoggedIn, image, username } = useSelector((store) => ({
    isLoggedIn: store.isLoggedIn,
    displayName: store.displayName,
    image: store.image,
    username: store.username,
  }));
  const { t } = useTranslation();
  const dispatch = useDispatch();

  const onLogoutSuccess = () => {
    dispatch(logoutSucces());
  };

  return (
    <div className="position-sticky top-0 start-0 bottom-1 bg-white text-dark">
      {isLoggedIn && (
        <div className="">
          <div className="card-body">
            <ul className="list-group">
              <li className="list-group-item text-center list-group-item-action d-flex align-items-center justify-content-center">
                <Link to="/" className="d-flex align-items-center text-dark" style={{ textDecoration: "none" }}>
                  <img
                    src={logo}
                    width="80"
                    alt="Social logo"
                    className="mr-2"
                  />
                  <em><strong style={{ cursor: "pointer" }}>
                    {t("Social Cafe")}
                  </strong></em>
                </Link>
              </li>

              <li className="list-group-item list-group-item-action">
                <Link
                  to="/"
                  className="d-flex align-items-center text-dark"
                  style={{ textDecoration: "none" }}
                >
                  <i className="fas fa-home fa-lg me-3"></i>
                  {t("Home")}
                </Link>
              </li>
              <li className="list-group-item list-group-item-action">
                <Link
                  to={"/users/" + username}
                  className="d-flex text-dark text-dark"
                  style={{ textDecoration: "none" }}
                >
                  <ProfileImageWithDefault
                    image={image}
                    width="24"
                    height="24"
                    className="rounded-circle me-2 "
                  />
                  <span>{displayName}</span>
                </Link>
              </li>
              <li className="list-group-item list-group-item-action">
                <Link
                  to={"/users/" + username}
                  className="d-flex align-items-center text-dark"
                  style={{ textDecoration: "none" }}
                >
                  <i className="fas fa-user fa-lg me-1"></i>
                  {t("Profile")}
                </Link>
              </li>

              <li
                className="list-group-item list-group-item-action text-primary"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-magnifying-glass fa-lg me-auto"></i>{" "}
                {t("Explore")}
              </li>

              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-bell fa-lg me-auto text-warning"></i>{" "}
                {t("Notifications")}
              </li>
              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-envelope fa-lg me-auto text-secondary"></i>{" "}
                {t("Messages")}
              </li>

              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-user-group fa-lg me-auto"></i> {t("Friends")}
              </li>
              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-heart fa-lg me-auto text-danger"></i>{" "}
                {t("Favorites")}
              </li>
              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-circle-check fa-lg me-auto text-info"></i>{" "}
                {t("Verified User")}
              </li>
              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-circle-info fa-lg me-auto text-success"></i>{" "}
                {t("Help")}
              </li>
              <li
                className="list-group-item list-group-item-action"
                style={{ cursor: "pointer" }}
              >
                <i className="fas fa-cog fa-lg me-auto"></i> {t("Settings")}
              </li>
              <li className="list-group-item" onClick={onLogoutSuccess}>
                <Link
                  to="/login"
                  className="d-flex align-items-center"
                  style={{ textDecoration: "none" }}
                >
                  <i class="fa-solid fa-right-from-bracket fa-lg me-1"></i>
                  {t("Logout")}
                </Link>
              </li>
              <li className="list-group-item d-flex justify-content-center">
                <LanguageSelector />
              </li>
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default Sidebar;
